# ============================ Common property definitions, shared between 2 or more shapes ============================


:acceptedBy
    a                        oslc:Property ;
    oslc:name                "acceptedBy" ;
    oslc:propertyDefinition  oslc_config:acceptedBy ;
    oslc:occurs              oslc:Zero-or-many ;
    oslc:readOnly            true ;
    oslc:representation      oslc:Reference ;
    oslc:range               rdfs:Class ;
    oslc:valueType           oslc:Resource ;
    dcterms:description      """A type of configuration that accepts this configuration as a contribution.
{{A configuration with no value for `oslc_config:acceptedBy` MUST NOT be used as a contribution to any other configuration}} -
that is, it can only be a root of a configuration hierarchy
(or a stand-alone configuration if there is also no value for `oslc_config:accepts`). Such configurations should be rare."""^^rdf:XMLLiteral .

:accepts
    a                        oslc:Property ;
    oslc:name                "accepts" ;
    oslc:propertyDefinition  oslc_config:accepts ;
    oslc:occurs              oslc:Zero-or-many ;
    oslc:readOnly            true ;
    oslc:representation      oslc:Reference ;
    oslc:valueType           oslc:Resource ;
    oslc:range               rdfs:Class ;
    dcterms:description      """A type of configuration that is acceptable as a contribution to this stream.
A configuration with no value for this predicate accepts no contributions -
that is, it can only be a leaf in a configuration hierarchy."""^^rdf:XMLLiteral .

:archived
    a                        oslc:Property ;
    oslc:name                "archived" ;
    oslc:occurs              oslc:Zero-or-one ;
    oslc:propertyDefinition  oslc:archived ;
    oslc:valueType           xsd:boolean ;
    dcterms:description      "Indicates whether the subject has been marked as archived, no longer an active resource."^^rdf:XMLLiteral .

