# ============================ Component shape ============================


:ComponentShape
    a                       oslc:ResourceShape ;
    oslc:describes          oslc_config:Component ;
    dcterms:title           "The shape of a component." ;
    dcterms:description     """A set of versioned resources; a configuration selects zero, one, or (very rarely) more than one version of these resources.
{{A component itself MAY be a versioned resource}},
indicated by the RDF type `oslc_config:VersionResource` on its versions, but need not be versioned;
the semantics of versioned components are not defined by this specification.
Typically, components themselves are not nested - that is,
typically none of the members of an `oslc_config:Component` container are themselves of type `oslc_config:Component`;
any required structure and hierarchy is realized through configurations,
or through the structures within the configuration items themselves (e.g., versioned folders or directories)."""^^rdf:XMLLiteral ;
    oslc:property

        # Property definitions unique to Component

        [
            #type
            a                        oslc:Property ;
            oslc:name                "type" ;
            oslc:propertyDefinition  rdf:type ;
            oslc:occurs              oslc:One-or-many ;
            oslc:representation      oslc:Reference ;
            oslc:valueType           oslc:Resource ;
            oslc:range               rdfs:Class ;
            dcterms:description      """A resource type URI. {{A Component MUST have a resource type of `oslc_config:Component`}}.
{{A component MAY be a Linked Data Platform Container,
containing the concept resources associated with this component}}.
{{The members of such an `oslc_config:Component` container MUST NOT be of type `oslc_config:Configuration`}};
sub-configurations are given in the `oslc_config:contributions` property.
No meaning is assigned to a member of type `oslc_config:Component`;
neither client nor server is obligated to perform any recursion through nested Components.
{{Servers MAY treat the `rdf:type` property for a component as read-only."""^^rdf:XMLLiteral
        ] ,
        [
            #configurations
            a                        oslc:Property ;
            oslc:name                "configurations" ;
            oslc:propertyDefinition  oslc_config:configurations ;
            oslc:occurs              oslc:Exactly-one ;
            oslc:readOnly            true ;
            oslc:representation      oslc:Reference ;
            oslc:valueType           oslc:Resource ;
            oslc:range               ldp:Container ;
            dcterms:description      """The Linked Data Platform Container
that contains all the configurations (both streams and baselines) of this component.
{{The `oslc_config:configurations` property on a component is read-only; servers MAY also treat the referenced container as read-only}}.
If it is not read-only, {{the container MAY have an `oslc:resourceShape` property referencing a resource shape that describes the
container}}. {{If a container resource shape is specified, the shape SHOULD have a property describing the membership of the container with a
`oslc:valueShape` referencing a resource shape that describes the shapes of streams and baselines that may be created}}."""^^rdf:XMLLiteral
        ] ,

        # Properties shared with other shapes

        :archived ,
        :contributor ,
        :created ,
        :creator ,
        :description ,
        :identifier ,
        :instanceShape ,
        :modified ,
        :modifiedBy ,
        :serviceProvider ,
        :shortId ,
        :shortTitle ,
        :subject ,
        :title .


# ============================ Baseline shape ============================


:BaselineShape
    a                        oslc:ResourceShape ;
    oslc:describes           oslc_config:Baseline ;
