:identifiedDate
	a rdf:Property ;
	rdfs:isDefinedBy : ;
	rdfs:label "identifiedDate" ;
	rdfs:comment """identifiedDate is an optional property of a Risk resource.  It is the identified date of the Risk resource.  Its value is a dateTime.""" ;
   .

