                "@id": "http://open-services.net/ns/sysmlv2#"
            },
            "rdfs:comment": "An ownedMember of this Type that is a Multiplicity, which constraints the cardinality of the Type. If there is no such ownedMember, then the cardinality of this Type is constrained by all the Multiplicity constraints applicable to any direct supertypes.",
