                "@id": "http://open-services.net/ns/sysmlv2#"
            },
            "rdfs:comment": "A LifeClass is a Class that specializes both the Class Occurrences::Life from the Kernel Semantic Library and a single OccurrenceDefinition, and has a multiplicity of 0..1. This constrains the OccurrenceDefinition being specialized to have at most one instance that is a complete Life.",
            "rdfs:label": "LifeClass",
