            },
            "rdfs:isDefinedBy": {
                "@id": "http://open-services.net/ns/sysmlv2#"
            },
            "rdfs:comment": "Unioning is a Relationship that makes its unioningType one of the unioningTypes of its typeUnioned.",
            "rdfs:label": "Unioning",
            "@type": "rdfs:Class"
        },
        {
            "@id": "oslc_sysmlv2:Relationship",
