                "@id": "oslc_sysmlv2:Element"
            },
            "rdfs:isDefinedBy": {
                "@id": "http://open-services.net/ns/sysmlv2#"
            },
            "rdfs:comment": "A Relationship is an Element that relates other Element. Some of its relatedElements may be owned, in which case those ownedRelatedElements will be deleted from a model if their owningRelationship is. A Relationship may also be owned by another Element, in which case the ownedRelatedElements of the Relationship are also considered to be transitively owned by the owningRelatedElement of the Relationship.",
            "rdfs:label": "Relationship",
            "@type": "rdfs:Class"
        },
        {
            "@id": "oslc_sysmlv2:calculationUsage_CalculationDefinition",
            "rdfs:isDefinedBy": {
                "@id": "http://open-services.net/ns/sysmlv2#"
            },
            "rdfs:comment": "The Function that is the type of this CalculationUsage. Nominally, this would be a CalculationDefinition, but a kernel Function is also allowed, to permit use of Functions from the Kernel Model Libraries.",
            "rdfs:label": "calculationUsage_CalculationDefinition",
            "@type": "rdf:Property"
        },
        {
            "@id": "oslc_sysmlv2:assertConstraintUsage_AssertedConstraint",
            "rdfs:isDefinedBy": {
                "@id": "http://open-services.net/ns/sysmlv2#"
            },
            "rdfs:comment": "The ConstraintUsage to be performed by the AssertConstraintUsage. It is the referenceFeature of the ownedReferenceSubsetting for the AssertConstraintUsage, if there is one, and, otherwise, the AssertConstraintUsage itself.",
