            "@type": "rdf:Property"
        },
        {
            "@id": "oslc_sysmlv2:constraintUsage_ConstraintDefinition",
            "rdfs:isDefinedBy": {
                "@id": "http://open-services.net/ns/sysmlv2#"
            },
            "rdfs:comment": "The (single) Predicate that is the type of this ConstraintUsage. Nominally, this will be a ConstraintDefinition, but other kinds of Predicates are also allowed, to permit use of Predicates from the Kernel Model Libraries.",
            "rdfs:label": "constraintUsage_ConstraintDefinition",
            "@type": "rdf:Property"
        },
        {
            "@id": "oslc_sysmlv2:element_OwningNamespace",
            "rdfs:isDefinedBy": {
