            },
            "rdfs:comment": "The owned ConstraintUsages that represent requirements of this RequirementUsage, which are the ownedConstraints of the RequirementConstraintMemberships of the RequirementUsage with kind = requirement.",
            "rdfs:label": "requirementUsage_RequiredConstraint",
            "@type": "rdf:Property"
