            "rdfs:isDefinedBy": {
                "@id": "http://open-services.net/ns/sysmlv2#"
            },
            "rdfs:comment": "Whether the ownedStates of this StateDefinition are to all be performed in parallel. If true, none of the ownedActions (which includes ownedStates) may have any incoming or outgoing Transitions. If false, only one ownedState may be performed at a time.",
            "rdfs:label": "stateDefinition_IsParallel",
            "@type": "rdf:Property"
        },
        {
            "@id": "oslc_sysmlv2:intersecting_IntersectingType",
