            "@type": "rdfs:Class"
        },
        {
            "@id": "oslc_sysmlv2:featureInverting_InvertingFeature",
            "rdfs:isDefinedBy": {
                "@id": "http://open-services.net/ns/sysmlv2#"
            },
            "rdfs:comment": "The Feature that is an inverse of the invertedFeature.",
            "rdfs:label": "featureInverting_InvertingFeature",
            "@type": "rdf:Property"
        },
        {
            "@id": "oslc_sysmlv2:TransitionUsage",
            "rdfs:subClassOf": {
