            "rdfs:label": "ConstraintUsage",
            "@type": "rdfs:Class"
        },
        {
            "@id": "oslc_sysmlv2:EventOccurrenceUsage",
            "rdfs:subClassOf": {
                "@id": "oslc_sysmlv2:OccurrenceUsage"
            },
            "rdfs:isDefinedBy": {
                "@id": "http://open-services.net/ns/sysmlv2#"
