    rdfs:comment "The ownedRelationships of this Type that are Intersectings, have the Type as their typeIntersected." ;
    rdfs:isDefinedBy oslc_sysmlv2: .

oslc_sysmlv2:type_OwnedSpecialization a rdf:Property ;
    rdfs:label "type_OwnedSpecialization" ;
