oslc_sysmlv2:type_UnioningType a rdf:Property ;
    rdfs:label "type_UnioningType" ;
    rdfs:comment "The interpretations of a Type with unioningTypes are asserted to be the same as those of all the unioningTypes together, which are the Types derived from the unioningType of the ownedUnionings of this Type. For example, a Classifier for people might be the union of Classifiers for all the sexes. Similarly, a feature for people's children might be the union of features dividing them in the same ways as people in general." ;
    rdfs:isDefinedBy oslc_sysmlv2: .

oslc_sysmlv2:unioning_TypeUnioned a rdf:Property ;
    rdfs:label "unioning_TypeUnioned" ;
    rdfs:comment "Type with interpretations partly determined by unioningType, as described in Type::unioningType." ;
    rdfs:isDefinedBy oslc_sysmlv2: .

oslc_sysmlv2:unioning_UnioningType a rdf:Property ;
    rdfs:label "unioning_UnioningType" ;
    rdfs:comment "Type that partly determines interpretations of typeUnioned, as described in Type::unioningType." ;
    rdfs:isDefinedBy oslc_sysmlv2: .

oslc_sysmlv2:usage_Definition a rdf:Property ;
    rdfs:label "usage_Definition" ;
    rdfs:comment "The Classifiers that are the types of this Usage. Nominally, these are Definitions, but other kinds of Kernel Classifiers are also allowed, to permit use of Classifiers from the Kernel Model Libraries." ;
