oslc_sysmlv2:usage_Variant a rdf:Property ;
    rdfs:label "usage_Variant" ;
    rdfs:comment "The Usages which represent the variants of this Usage as a variation point Usage, if isVariation = true. If isVariation = false, then there must be no variants." ;
