oslc_sysmlv2:usage_VariantMembership a rdf:Property ;
    rdfs:label "usage_VariantMembership" ;
    rdfs:comment "The ownedMemberships of this Usage that are VariantMemberships. If isVariation = true, then this must be all memberships of the Usage. If isVariation = false, then variantMembershipmust be empty." ;
    rdfs:isDefinedBy oslc_sysmlv2: .

oslc_sysmlv2:useCaseDefinition_IncludedUseCase a rdf:Property ;
    rdfs:label "useCaseDefinition_IncludedUseCase" ;
    rdfs:comment "The UseCaseUsages that are included by this UseCaseDefinition, which are the useCaseIncludeds of the IncludeUseCaseUsages owned by this UseCaseDefinition." ;
