oslc_sysmlv2:useCaseUsage_IncludedUseCase a rdf:Property ;
    rdfs:label "useCaseUsage_IncludedUseCase" ;
    rdfs:comment "The UseCaseUsages that are included by this UseCaseUse, which are the useCaseIncludeds of the IncludeUseCaseUsages owned by this UseCaseUsage." ;
