oslc_sysmlv2:viewRenderingMembership_ReferencedRendering a rdf:Property ;
    rdfs:label "viewRenderingMembership_ReferencedRendering" ;
    rdfs:comment " The RenderingUsage that is referenced through this ViewRenderingMembership. It is the referencedFeature of the ownedReferenceSubsetting for the ownedRendering, if there is one, and, otherwise, the ownedRendering itself." ;
    rdfs:isDefinedBy oslc_sysmlv2: .

oslc_sysmlv2:viewUsage_ExposedElement a rdf:Property ;
    rdfs:label "viewUsage_ExposedElement" ;
    rdfs:comment "The Elements that are exposed by this ViewUsage, which are those memberElements of the imported Memberships from all the Expose Relationships that meet all the owned and inherited viewConditions." ;
