                "@value": "This property, when present, describes a patch to be applied to the antecedent resource‚Äôs RDF representation. A patch cannot describe a change to the non-RDF contents of a resource.\nThe result of applying the patch describes the representation of the resource referenced in the trs:changed property immediately after this change event.\nThis property is used with trs:Modification and trs:Creation Change Events; it is not meaningful for trs:Deletion Change Events. The format of the patch property is defined at TRS Patch.",
